import React from "react";
import Button from 'react-bootstrap/Button';

function Home() {

  return (
    <>
    <Button variant="primary" href="http://localhost:3000/locations">Locations</Button>
    <Button href="http://localhost:3000/venues">Venues</Button> 
    </>
  );
}

export default Home;
